import Buttons from './Buttons';
import styled from 'styled-components';



function Main() {
  function clickMe()
  {
      alert ('You clicked me!')
  }
  return (
    <>
        <div>
            <Button theme="RecordButton" onClick={clickMe}>
            Record Fuel
            </Button>
        </div>
        <div>
        <Button theme="RecordButton" onClick={clickMe}>
            Record Mileage
            </Button>
        </div>
        <div>
        <Button theme="ResultsButton" onClick={clickMe}>
            View Results
            </Button>
        </div>
    </>
  )
}

export default Main;
